import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { MatCardModule } from '@angular/material/card';
import { MatIconModule } from '@angular/material/icon';
import { MatFormFieldModule } from '@angular/material/form-field';
import { MatButtonModule } from '@angular/material/button';

@Component({
  selector: 'app-user-details',
  standalone: true,
  imports: [
    CommonModule,
    MatCardModule,
    MatIconModule,
    MatButtonModule,
    MatIconModule,
  ],
  templateUrl: './user-details.component.html',
  styleUrls: ['./user-details.component.css'],
})
export class UserDetailsComponent {
  openUserAdressEditPopup(): void {}
}
<mat-card class="user-details">
  <mat-card-header>
    <mat-card-title>Hi, John Doe</mat-card-title>
  </mat-card-header>

  <mat-card-content>
    <p>ID: 123456789</p>
    <div>
      <p>Address: New York, Broadway 123, Apt 4, 10001</p>
      <button
        mat-raised-button
        color="primary"
        (click)="openUserAdressEditPopup()"
      >
        change address <mat-icon>edit</mat-icon>
      </button>
    </div>
  </mat-card-content>
</mat-card>
